import React from 'react';

function AboutUs() {
    return (
        <div className="container py-5">
            <h2 className="bg-green text-center mb-4">About Us</h2>
            <p>
                We are a team dedicated to providing fun and engaging quizzes on various topics.
                Our goal is to help you test your knowledge and learn new things in a fun way.
                You can attempt the quiz in both Hindi and English, and share your results with friends!
            </p>
        </div>
    );
}

export default AboutUs;
